//
//           2.2.1. CNO_HUFFMAN_LEAF_EOS:   set eos = 1
//           2.2.2. CNO_HUFFMAN_LEAF_CHAR:  append character in `data` to output.
//           2.2.3. CNO_HUFFMAN_LEAF_ERROR: return CNO_ERROR_TRANSPORT("invalid Huffman code")
//
